Raj Nartaki is a 1941 Vintage Classic produced by Wadia Brothers and directed by Maghu Bose. The dialog is in English but the songs are in Hindi and are hard-subbed.

The film tells the tale of doomed love between a courtesan and a prince. Based on a Bengali play by dramatist Manmath Ray (1899-1988), the film starred the legendary Prithviraj Kapoor (1906-1972), one of the doyens of Indian cinema, as Prince Chandrakirti, and the accomplished Sadhona Bose (1914-1973), an exponent of both Kathak and Manipuri dance forms, in the role of the court dancer Indrani.

